using System;
using UnityEngine;

namespace BeatSaberOnline.Data
{
    public static class Sprites
    {
        private static string onlineBase64 = "";
        private static string checkmark64 = "";
        private static string cross64 = "";

        public static Sprite onlineIcon;
        public static Sprite checkmarkIcon;
        public static Sprite crossIcon;

        public static void Init()
        {
            onlineIcon = Base64ToSprite(onlineBase64);
            checkmarkIcon = Base64ToSprite(checkmark64);
            crossIcon = Base64ToSprite(cross64);
        }

        public static Sprite Base64ToSprite(string base64)
        {
            Texture2D tex = Base64ToTexture2D(base64);
            Sprite sprite = Sprite.Create(tex, new Rect(0, 0, tex.width, tex.height), (Vector2.one / 2f));
            return sprite;
        }

        public static Texture2D Base64ToTexture2D(string encodedData)
        {
            byte[] imageData = Convert.FromBase64String(encodedData);
            Texture2D texture = new Texture2D(1, 1, TextureFormat.ARGB32, false, true)
            {
                hideFlags = HideFlags.HideAndDontSave,
                filterMode = FilterMode.Trilinear
            };
            texture.LoadImage(imageData);
            return texture;
        }
    }
}
